import React from "react";

const NavBar = () => {
	return (
		<nav className="nav-bar">
			div.
			<ol>
				<li className="nav-elem"><a href="/users">Users</a></li>
				<li className="nav-elem"><a href="/orders">Orders</a></li>
				<li className="nav-elem"><a href="/products">Products</a></li>
			</ol>
		</nav>
	)
}

export default NavBar;
